import React, { useState, useEffect } from 'react';

function App() {
  const [dates, setDates] = useState([]);
  const [newDate, setNewDate] = useState({ name: '', rating: 5, notes: '' });
  const [activeTab, setActiveTab] = useState('home');
  const [user, setUser] = useState(null);
  const [authForm, setAuthForm] = useState({ email: '', password: '', username: '', firstName: '', lastName: '' });
  const [isLogin, setIsLogin] = useState(true);
  const [loading, setLoading] = useState(false);

  // Check if user is logged in on app start
  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      // Verify token with backend
      verifyToken(token);
    }
  }, []);

  const verifyToken = async (token) => {
    try {
      const response = await fetch('http://localhost:5001/api/users/me', {
        headers: { 'Authorization': `Bearer ${token}` }
      });
      if (response.ok) {
        const userData = await response.json();
        setUser(userData);
        setActiveTab('home');
      } else {
        localStorage.removeItem('token');
      }
    } catch (error) {
      localStorage.removeItem('token');
    }
  };

  const handleAuth = async () => {
    setLoading(true);
    try {
      const endpoint = isLogin ? '/api/auth/login' : '/api/auth/register';
      const response = await fetch(`http://localhost:5001${endpoint}`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(authForm)
      });

      const data = await response.json();

      if (response.ok) {
        localStorage.setItem('token', data.token);
        setUser(data.user);
        setActiveTab('home');
        alert(isLogin ? 'Login successful!' : 'Registration successful!');
      } else {
        alert(data.message || 'Authentication failed');
      }
    } catch (error) {
      alert('Network error: ' + error.message);
    } finally {
      setLoading(false);
    }
  };

  const logout = () => {
    localStorage.removeItem('token');
    setUser(null);
    setDates([]);
    setActiveTab('home');
  };

  const addDate = async () => {
    if (newDate.name.trim()) {
      const dateWithId = {
        ...newDate,
        id: Date.now(),
        date: new Date().toLocaleDateString(),
        userId: user?.id
      };

      // Save to backend if user is logged in
      if (user) {
        try {
          const response = await fetch('http://localhost:5001/api/dates', {
            method: 'POST',
            headers: {
              'Content-Type': 'application/json',
              'Authorization': `Bearer ${localStorage.getItem('token')}`
            },
            body: JSON.stringify({
              profileName: newDate.name,
              date: new Date().toISOString(),
              rating: newDate.rating,
              notes: newDate.notes
            })
          });

          if (response.ok) {
            const savedDate = await response.json();
            setDates([...dates, { ...dateWithId, id: savedDate.id }]);
          } else {
            // Fallback to local storage
            setDates([...dates, dateWithId]);
          }
        } catch (error) {
          // Fallback to local storage
          setDates([...dates, dateWithId]);
        }
      } else {
        // Local storage only
        setDates([...dates, dateWithId]);
      }

      setNewDate({ name: '', rating: 5, notes: '' });
    }
  };

  const removeDate = (id) => {
    setDates(dates.filter(date => date.id !== id));
  };

  const testAPI = async () => {
    try {
      const response = await fetch('http://localhost:5001/health');
      const data = await response.json();
      alert(`API Test: ${data.message}`);
    } catch (error) {
      alert('API Test Failed: ' + error.message);
    }
  };

  const renderAuth = () => (
    <div style={{ maxWidth: '400px', margin: '0 auto', padding: '20px' }}>
      <h2>{isLogin ? 'üîê Login' : 'üìù Register'}</h2>

      {!isLogin && (
        <>
          <div style={{ marginBottom: '15px' }}>
            <label style={{ display: 'block', marginBottom: '5px' }}>First Name:</label>
            <input
              type="text"
              value={authForm.firstName}
              onChange={(e) => setAuthForm({...authForm, firstName: e.target.value})}
              style={{ width: '100%', padding: '8px', borderRadius: '4px', border: '1px solid #ddd' }}
            />
          </div>
          <div style={{ marginBottom: '15px' }}>
            <label style={{ display: 'block', marginBottom: '5px' }}>Last Name:</label>
            <input
              type="text"
              value={authForm.lastName}
              onChange={(e) => setAuthForm({...authForm, lastName: e.target.value})}
              style={{ width: '100%', padding: '8px', borderRadius: '4px', border: '1px solid #ddd' }}
            />
          </div>
          <div style={{ marginBottom: '15px' }}>
            <label style={{ display: 'block', marginBottom: '5px' }}>Username:</label>
            <input
              type="text"
              value={authForm.username}
              onChange={(e) => setAuthForm({...authForm, username: e.target.value})}
              style={{ width: '100%', padding: '8px', borderRadius: '4px', border: '1px solid #ddd' }}
            />
          </div>
        </>
      )}

      <div style={{ marginBottom: '15px' }}>
        <label style={{ display: 'block', marginBottom: '5px' }}>Email:</label>
        <input
          type="email"
          value={authForm.email}
          onChange={(e) => setAuthForm({...authForm, email: e.target.value})}
          style={{ width: '100%', padding: '8px', borderRadius: '4px', border: '1px solid #ddd' }}
        />
      </div>

      <div style={{ marginBottom: '15px' }}>
        <label style={{ display: 'block', marginBottom: '5px' }}>Password:</label>
        <input
          type="password"
          value={authForm.password}
          onChange={(e) => setAuthForm({...authForm, password: e.target.value})}
          style={{ width: '100%', padding: '8px', borderRadius: '4px', border: '1px solid #ddd' }}
        />
      </div>

      <button 
        onClick={handleAuth}
        disabled={loading}
        style={{ 
          width: '100%',
          padding: '12px', 
          backgroundColor: '#1976d2', 
          color: 'white', 
          border: 'none', 
          borderRadius: '4px',
          cursor: loading ? 'not-allowed' : 'pointer',
          opacity: loading ? 0.7 : 1
        }}
      >
        {loading ? 'Loading...' : (isLogin ? 'Login' : 'Register')}
      </button>

      <button 
        onClick={() => setIsLogin(!isLogin)}
        style={{ 
          width: '100%',
          marginTop: '10px',
          padding: '8px', 
          backgroundColor: 'transparent', 
          color: '#1976d2', 
          border: '1px solid #1976d2', 
          borderRadius: '4px',
          cursor: 'pointer'
        }}
      >
        {isLogin ? 'Need an account? Register' : 'Have an account? Login'}
      </button>
    </div>
  );

  const renderHome = () => (
    <div>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' }}>
        <h1 style={{ color: '#1976d2', margin: 0 }}>üéØ Roster.AI</h1>
        {user ? (
          <div style={{ display: 'flex', alignItems: 'center', gap: '10px' }}>
            <span>Welcome, {user.firstName || user.username}!</span>
            <button 
              onClick={logout}
              style={{ 
                padding: '8px 16px', 
                backgroundColor: '#dc004e', 
                color: 'white', 
                border: 'none', 
                borderRadius: '4px',
                cursor: 'pointer'
              }}
            >
              Logout
            </button>
          </div>
        ) : (
          <button 
            onClick={() => setActiveTab('auth')}
            style={{ 
              padding: '8px 16px', 
              backgroundColor: '#1976d2', 
              color: 'white', 
              border: 'none', 
              borderRadius: '4px',
              cursor: 'pointer'
            }}
          >
            Login
          </button>
        )}
      </div>

      <p>Welcome to your dating evaluation platform!</p>

      <div style={{ marginTop: '30px' }}>
        <h2>Features:</h2>
        <ul>
          <li>‚úÖ Evaluate your dates</li>
          <li>‚úÖ Build your roster</li>
          <li>‚úÖ Get AI insights</li>
          <li>‚úÖ Track dating progress</li>
          {user && <li>‚úÖ Data persistence</li>}
        </ul>
      </div>

      <div style={{ marginTop: '30px', padding: '20px', backgroundColor: '#f5f5f5', borderRadius: '8px' }}>
        <h3>Quick Actions:</h3>
        <button 
          onClick={() => setActiveTab('add-date')}
          style={{ 
            margin: '5px', 
            padding: '10px 20px', 
            backgroundColor: '#1976d2', 
            color: 'white', 
            border: 'none', 
            borderRadius: '4px',
            cursor: 'pointer'
          }}
        >
          Add New Date
        </button>
        <button 
          onClick={() => setActiveTab('roster')}
          style={{ 
            margin: '5px', 
            padding: '10px 20px', 
            backgroundColor: '#dc004e', 
            color: 'white', 
            border: 'none', 
            borderRadius: '4px',
            cursor: 'pointer'
          }}
        >
          View Roster ({dates.length})
        </button>
        <button 
          onClick={testAPI}
          style={{ 
            margin: '5px', 
            padding: '10px 20px', 
            backgroundColor: '#4caf50', 
            color: 'white', 
            border: 'none', 
            borderRadius: '4px',
            cursor: 'pointer'
          }}
        >
          Test API
        </button>
      </div>

      <div style={{ marginTop: '30px', fontSize: '14px', color: '#666' }}>
        <p>Backend API: ‚úÖ Running on port 5001</p>
        <p>Frontend: ‚úÖ Running on port 3001</p>
        <p>Total Dates in Roster: {dates.length}</p>
        <p>User Status: {user ? `‚úÖ Logged in as ${user.email}` : '‚ùå Not logged in'}</p>
      </div>
    </div>
  );

  const renderAddDate = () => (
    <div>
      <h2>üìù Add New Date</h2>
      <div style={{ maxWidth: '400px', margin: '20px 0' }}>
        <div style={{ marginBottom: '15px' }}>
          <label style={{ display: 'block', marginBottom: '5px' }}>Name:</label>
          <input
            type="text"
            value={newDate.name}
            onChange={(e) => setNewDate({...newDate, name: e.target.value})}
            style={{ width: '100%', padding: '8px', borderRadius: '4px', border: '1px solid #ddd' }}
            placeholder="Enter their name"
          />
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label style={{ display: 'block', marginBottom: '5px' }}>Rating (1-10):</label>
          <input
            type="range"
            min="1"
            max="10"
            value={newDate.rating}
            onChange={(e) => setNewDate({...newDate, rating: parseInt(e.target.value)})}
            style={{ width: '100%' }}
          />
          <span>{newDate.rating}/10</span>
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label style={{ display: 'block', marginBottom: '5px' }}>Notes:</label>
          <textarea
            value={newDate.notes}
            onChange={(e) => setNewDate({...newDate, notes: e.target.value})}
            style={{ width: '100%', padding: '8px', borderRadius: '4px', border: '1px solid #ddd', height: '80px' }}
            placeholder="How was the date? Any red/green flags?"
          />
        </div>
        <button 
          onClick={addDate}
          style={{ 
            padding: '10px 20px', 
            backgroundColor: '#1976d2', 
            color: 'white', 
            border: 'none', 
            borderRadius: '4px',
            cursor: 'pointer',
            marginRight: '10px'
          }}
        >
          Add to Roster
        </button>
        <button 
          onClick={() => setActiveTab('home')}
          style={{ 
            padding: '10px 20px', 
            backgroundColor: '#666', 
            color: 'white', 
            border: 'none', 
            borderRadius: '4px',
            cursor: 'pointer'
          }}
        >
          Back to Home
        </button>
      </div>
    </div>
  );

  const renderRoster = () => (
    <div>
      <h2>üë• Your Dating Roster</h2>
      {dates.length === 0 ? (
        <p>No dates added yet. <button onClick={() => setActiveTab('add-date')} style={{ color: '#1976d2', background: 'none', border: 'none', cursor: 'pointer', textDecoration: 'underline' }}>Add your first date!</button></p>
      ) : (
        <div>
          {dates.map(date => (
            <div key={date.id} style={{ 
              border: '1px solid #ddd', 
              borderRadius: '8px', 
              padding: '15px', 
              margin: '10px 0',
              backgroundColor: '#f9f9f9'
            }}>
              <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                <h3 style={{ margin: '0' }}>{date.name}</h3>
                <button 
                  onClick={() => removeDate(date.id)}
                  style={{ 
                    backgroundColor: '#dc004e', 
                    color: 'white', 
                    border: 'none', 
                    borderRadius: '4px', 
                    padding: '5px 10px',
                    cursor: 'pointer'
                  }}
                >
                  Remove
                </button>
              </div>
              <p style={{ margin: '5px 0', color: '#666' }}>Date: {date.date}</p>
              <p style={{ margin: '5px 0' }}>Rating: {'‚≠ê'.repeat(date.rating)} ({date.rating}/10)</p>
              {date.notes && <p style={{ margin: '5px 0' }}>Notes: {date.notes}</p>}
            </div>
          ))}
        </div>
      )}
      <button 
        onClick={() => setActiveTab('home')}
        style={{ 
          marginTop: '20px',
          padding: '10px 20px', 
          backgroundColor: '#666', 
          color: 'white', 
          border: 'none', 
          borderRadius: '4px',
          cursor: 'pointer'
        }}
      >
        Back to Home
      </button>
    </div>
  );

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif', maxWidth: '800px', margin: '0 auto' }}>
      {activeTab === 'auth' && renderAuth()}
      {activeTab === 'home' && renderHome()}
      {activeTab === 'add-date' && renderAddDate()}
      {activeTab === 'roster' && renderRoster()}
    </div>
  );
}

export default App;
